  \"Nontarget Effects of the Mosquito Larvicides, Temephos and Methoprene, at Bombay
  Hook and Prime Hook National Wildlife Refuges\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  39,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:12.259609\",\n\t\"name\": \"nontarget-effects-of-the-mosquito-larvicides-temephos-and-methoprene-at-bombay-hook-and-pr\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study generated the following recommendations:
  1. Continued spraying of Abate 4E or Altosid on saltmarsh habitats should be permitted
  while the U.S. Fish and Wildlife Service, researchers and mosquito control agencies
  investigate alternative methods of mosquito control and evaluate the relative risks
  of various control methods. The study results suggest the need to continue to monitor
  for non-target impacts of Abate 4E on fiddler crabs and other invertebrates, to
  evaluate whether effective mosquito control can be achieved at lower application
  rates of Abate 4E, and to determine whether the observed level of cholinesterase
  inhibition in fiddler crabs results in short or long-term toxicity. 2. Because nontarget
  impacts were observed on freshwater insects from the spraying of Abate 4E and because
  there is preliminary evidence of adverse impacts on frogs from Abate 4E and Altosid,
  we recommend that refuges discontinue the use of these larvicides on freshwater
  habitats. 3. Emergence traps are recommended as an effective tool for refuge managers
  to monitor insect populations in ponds.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
